import React from "react";
import BodyContainer from "./BodyContainer";
import FlexBox from "./FlexBox";

const Footer = () => {
    return (
        <BodyContainer className="border-t-[1px] bg-white">
            <FlexBox justify="center">
                <div>개인정보</div>
                <div>처리방침</div>
                <div>이용약관</div>
            </FlexBox>
        </BodyContainer>
    );
};

export default Footer;
